import React, { useState } from "react";
import { Container, Box, Typography, TextField, Button, Paper, Alert, Grid, Link } from "@mui/material";
import axios from "axios";
import { useNavigate } from "react-router-dom";

export default function LoginPage() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    if (!username || !password) {
      setError("Veuillez remplir tous les champs.");
      return;
    }
    try {
      const res = await axios.post("/api/auth/login", { username, password });
      localStorage.setItem("token", res.data.token);
      navigate("/fraudes");
    } catch (err) {
      setError(err.response?.data?.error || "Erreur lors de la connexion");
    }
  };

  return (
    <Box sx={{
      minHeight: '100vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      background: 'linear-gradient(135deg, #f857a6 0%, #ff5858 100%)',
    }}>
      <Container maxWidth="sm">
        <Paper elevation={12} sx={{
          p: { xs: 3, sm: 6 },
          borderRadius: 6,
          boxShadow: 12,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          background: 'rgba(255,255,255,0.98)',
          minWidth: { xs: '90vw', sm: 420 },
        }}>
          <Box sx={{ mb: 2 }}>
            <img src="/images/pngtree-button-senegal-flag-vector-template-design-png-image_859977.png" alt="Logo" style={{ width: 90, borderRadius: '50%' }} />
          </Box>
          <Typography variant="h4" align="center" gutterBottom sx={{ fontWeight: 700, color: '#f857a6', mb: 1 }}>
            Connexion
          </Typography>
          <Box sx={{ display: 'flex', flexDirection: 'row', gap: 2, width: '100%', mb: 3, justifyContent: 'center' }}>
            <Button variant="outlined" sx={{ minWidth: 56, width: 56, height: 56, borderRadius: '50%', borderColor: '#4285F4', p: 0 }}>
              <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/google/google-original.svg" alt="Google" style={{ width: 32, height: 32 }} />
            </Button>
            <Button variant="outlined" sx={{ minWidth: 56, width: 56, height: 56, borderRadius: '50%', borderColor: '#1877F3', p: 0 }}>
              <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/facebook/facebook-original.svg" alt="Facebook" style={{ width: 32, height: 32 }} />
            </Button>
            <Button variant="outlined" sx={{ minWidth: 56, width: 56, height: 56, borderRadius: '50%', borderColor: '#0A66C2', p: 0 }}>
              <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/linkedin/linkedin-original.svg" alt="LinkedIn" style={{ width: 32, height: 32 }} />
            </Button>
            <Button variant="outlined" sx={{ minWidth: 56, width: 56, height: 56, borderRadius: '50%', borderColor: '#E1306C', p: 0 }}>
              <img src="https://upload.wikimedia.org/wikipedia/commons/a/a5/Instagram_icon.png" alt="Instagram" style={{ width: 32, height: 32 }} />
            </Button>
          </Box>
          <Box component="form" onSubmit={handleSubmit} sx={{ width: '100%', mt: 1, display: 'flex', flexDirection: 'column', gap: 3 }}>
            <TextField label="Adresse email" variant="outlined" fullWidth required value={username} onChange={e => setUsername(e.target.value)} autoComplete="email"
              sx={{ background: '#fff', borderRadius: 2 }}
            />
            <TextField label="Mot de passe" type="password" variant="outlined" fullWidth required value={password} onChange={e => setPassword(e.target.value)} autoComplete="current-password"
              sx={{ background: '#fff', borderRadius: 2 }}
            />
            <Button type="submit" variant="contained" size="large" sx={{ mt: 2, fontWeight: 600, borderRadius: 2, background: 'linear-gradient(90deg, #f857a6 0%, #ff5858 100%)', color: '#fff', boxShadow: 3 }}>
              Se connecter
            </Button>
          </Box>
          <Grid container justifyContent="space-between" sx={{ mt: 2, width: '100%' }}>
            <Grid item>
              <Link href="/register" underline="hover" color="secondary" sx={{ fontWeight: 500 }}>
                Créer un compte
              </Link>
            </Grid>
            <Grid item>
              <Link href="/forgot-password" underline="hover" color="secondary" sx={{ fontWeight: 500 }}>
                Mot de passe oublié ?
              </Link>
            </Grid>
          </Grid>
          {error && <Alert severity="error" sx={{ mt: 2, width: '100%' }}>{error}</Alert>}
        </Paper>
      </Container>
    </Box>
  );
}
